import './App.css'

const Subsection = (subsection) => {
	const day = Object.keys(subsection.time);
    const time = Object.values(subsection.time);
	return(
		<div>
				{/* <h3>Subsections</h3> */}


				<div>
				<h4>{subsection.number}  <button>Add Subsection</button></h4>

				<ul>
					<li>{subsection.location}</li>
					<li>Metting Times
						<ul>
						{time.map((time, i) => (
						<li>{day[i]}:{time}</li>))}
						</ul>
					</li>
				</ul>) 
				</div>

			</div>

	)
}

